import React from 'react';

const Customer = ({customer:{imageBase64, phone, name, isGold}}) => {
    return (
        <>
            <img src={customer.imageBase64}/>
            <h3>{customer.name}</h3>
            <p>{customer.phone}</p>
            <p>Is Gold: {customer.isGold ? 'yes' : 'no'}</p>
        </>
    )
}

export default Customer;
